                value={email}

                />
                  <input
                onChange={ (e) => onHandlingCity(e)} 
                type="text" 
                placeholder="Ciudad"
                required
                value={city}

                />
                <button
                onClick={(e) => handlingSubmit(e) } 
                type="submit">Enviar</button>  
        </form>
        </>




    )
}

export default InterestedUsersForm
